select distinct `i_product_name`
from `item` as `i1`
where `i_manufact_id` between asymmetric 738 and 738 + 40 and (select count(*) as `item_cnt`
from `item`
where `i_manufact` = `i1`.`i_manufact` and (`i_category` = 'women' and (`i_color` = 'powder' or `i_color` = 'khaki') and (`i_units` = 'ounce' or `i_units` = 'oz') and (`i_size` = 'medium' or `i_size` = 'extra large') or `i_category` = 'women' and (`i_color` = 'brown' or `i_color` = 'honeydew') and (`i_units` = 'bunch' or `i_units` = 'ton') and (`i_size` = 'n/a' or `i_size` = 'small') or `i_category` = 'men' and (`i_color` = 'floral' or `i_color` = 'deep') and (`i_units` = 'n/a' or `i_units` = 'dozen') and (`i_size` = 'petite' or `i_size` = 'large') or `i_category` = 'men' and (`i_color` = 'light' or `i_color` = 'cornflower') and (`i_units` = 'box' or `i_units` = 'pound') and (`i_size` = 'medium' or `i_size` = 'extra large')) or `i_manufact` = `i1`.`i_manufact` and (`i_category` = 'women' and (`i_color` = 'midnight' or `i_color` = 'snow') and (`i_units` = 'pallet' or `i_units` = 'gross') and (`i_size` = 'medium' or `i_size` = 'extra large') or `i_category` = 'women' and (`i_color` = 'cyan' or `i_color` = 'papaya') and (`i_units` = 'cup' or `i_units` = 'dram') and (`i_size` = 'n/a' or `i_size` = 'small') or `i_category` = 'men' and (`i_color` = 'orange' or `i_color` = 'frosted') and (`i_units` = 'each' or `i_units` = 'tbl') and (`i_size` = 'petite' or `i_size` = 'large') or `i_category` = 'men' and (`i_color` = 'forest' or `i_color` = 'ghost') and (`i_units` = 'lb' or `i_units` = 'bundle') and (`i_size` = 'medium' or `i_size` = 'extra large'))) > 0
order by `i_product_name`
fetch next 100 rows only